import base64
import os
import unittest
import numpy as np
from pathlib import Path

from shapelets import init_session
from shapelets.model import Image
from shapelets.dsl import dsl_op as op
from urllib.request import urlopen


def generate_image(a: int, b: int, n: int) -> Image:
    import matplotlib.pyplot as plt

    x = np.linspace(a, b, n)
    y = np.sin(x ** 2) + np.cos(x)

    fig = plt.figure()
    plt.plot(x, y, label='Line 1')
    plt.plot(x, y - 0.6, label='Line 2')
    plt.legend()
    fig.suptitle("""Function Example\n\n""", fontweight="bold")

    return Image(fig)


class ImageTest(unittest.TestCase):
    @classmethod
    def setUpClass(cls):
        cls._client = init_session("admin", "admin", "https://127.0.0.1")
        cls._client.register_custom_function(generate_image)

    def test_function_images(self):
        a = 0
        b = 10
        c = 500

        node = op.generate_image(a, b, c)
        image_res = self._client.run(node)
        self.assertEqual(image_res.data, "")

    def test_image_from_file_descriptor(self):
        filename = f"{os.path.dirname(os.path.abspath(__file__))}{os.sep}..{os.sep}util{os.sep}resources{os.sep}shapelets-logo.png"
        image_data = open(filename, "rb").read()
        image = Image(image_data)
        self.assertEqual(base64.b64decode(image.data), open(filename, "rb").read())

    def test_image_from_file_descriptor_2(self):
        url = 'https://wp.shapelets.io/wp-content/uploads/2021/09/logo-nav.png'
        image_data = urlopen(url).read()

        image = Image(image_data)
        self.assertEqual(base64.b64decode(image.data), image_data)

    def test_image_from_path(self):
        filename = f"{os.path.dirname(os.path.abspath(__file__))}{os.sep}..{os.sep}util{os.sep}resources{os.sep}shapelets-logo.png"
        path = Path(filename)
        image = Image(path)
        self.assertEqual(base64.b64decode(image.data), open(path, 'rb').read())